const currEvent = input.event;
const prevEvent = input.context;

let res = {
    "id": currEvent.id,
    "name" : null,
    "email" : null,
    "country" : null,
    "login_timestamp" : null,
    "login_count": 0
}

// Signup
if (currEvent.event_type === "ACCOUNT_SIGNUP") {
    res.name = currEvent.first_name + " " + currEvent.last_name;
    res.email = currEvent.email;
    const countryCodeOutput = DR.solve("c82e8c20-8450-5238-cc9b-710818fc8574", {"country": currEvent.country}, "latest", SolverStrategy.STANDARD);
    if (countryCodeOutput && countryCodeOutput.length === 1) {
        res.country = countryCodeOutput[0].code || null;
    }
} else {
    res.name = prevEvent.name;
    res.email = prevEvent.email;
    res.country = prevEvent.country;
    if (currEvent.event_type === "LOGIN") {
        res.login_count = prevEvent.login_count + 1;
    }
}

// Dates
function alwaysGetDate(timestamp) {
    if (timestamp) {
        const adjustedTimestamp = timestamp.split(".").join(":");
        return new Date(adjustedTimestamp);
    } else {
        return new Date(-8640000000000000);
    }
}

const currentEventDate = alwaysGetDate(currEvent.event_timestamp);
const lastEventDate =  alwaysGetDate(prevEvent?.login_timestamp);

if (currEvent.event_type === "LOGIN" && currentEventDate > lastEventDate) {
    res.login_timestamp = currEvent.event_timestamp;
} else {
    res.login_timestamp = prevEvent?.login_timestamp || null;
}

output.output = res;
return output;

/* 
    1.  Input variables
    Input body is set in input variable 
*/
let a = input.a;
let b = input.b;

/*
    2.  Define simple "multiply" function
*/
function multiply(a, b) {
    return a * b;
}

/*
    3.  Execute multiply function and store value result variable
*/
let resultMultiply = multiply(a, b);

/*
    4.  Set output model which is returned in REST API
*/
output.result = resultMultiply;

/*
    Optionally: It is possible print values to console
*/
log('Result multiply:', resultMultiply);

/*
    5.  Return output  
*/
return output;

